/* eslint-disable prettier/prettier */
import React, {useEffect, useState, useRef, useCallback} from 'react';
import {View,Button,TouchableOpacity,PanResponder, Dimensions, Text as NormalText, Animated, NativeModules, Modal, Easing, Switch, Image as NormalImage} from 'react-native';
import {firebase} from '@react-native-firebase/database';
import Svg,{Path,Circle,G,Text, Image, SvgXml } from 'react-native-svg';
import { createNewSession, addPeriodToSession, writeToPeriod, storeAsyncData, readAsyncStore, syncRandomGuy } from '../storageFunctions';
import Timer from './Timer';
import LottieView from 'lottie-react-native';
import { BlurView } from '@react-native-community/blur';
import { blankHandle, rightHandle, leftHandle } from './xmlStringHelper';




const handleLogOut = async () => {
    try {
    await firebase.auth().signOut();
    } catch (error) {
    console.log(error);
    }
};

const getCurrentUserId = (): string | null => {
    const user = firebase.auth().currentUser;
    return user ? user.uid : null;
};

// eslint-disable-next-line @typescript-eslint/no-unused-vars
const HomeScreen = ({navigation,route}) =>
 {
    const btnRadius = 60;
    const dialRadius = 130;
    const dialWidth = 20;
    const meterColor = '#000000';
    const btnColor = '#fff';
    const fillColor = 'none';
    const strokeColor = '#D3D3D3';
    const strokeWidth = 20;
    const textSize = 50;
    const value = 0;
    const min = 0;
    const max = 359;
    const xCenter = Dimensions.get('window').width / 2;
    const yCenter = Dimensions.get('window').height / 2;
    const focusTime = useRef(1500);
    const breakTime = useRef(300);
    const [angle, setAngle] = useState(value);
    const refAngle = useRef(value);
    const phase = useRef('initial');
    const [phaseState,setPhaseState] = useState('initial');
    const [showOptions, setShowOptions] = useState(false);
	const [showHelp, setShowHelp] = useState(false);
    const [hardMode, setHardMode] = useState(false);

    useEffect(()=> {
        if (phaseState === 'break'){
            writeToPeriod('focusOT', timeOnClock.current);
        }
    },[phaseState]);



    const timeOnClock = useRef(0);

	const springFlag = useRef(0);

    useEffect(() => {
        syncRandomGuy();
        randomiseTimes();
		readAsyncStore('seenHelp').then((seen) =>{
			if (seen == null){
				setShowHelp(true);
				storeAsyncData([['seenHelp','true']]);
			}
		});
      }, []);
    const panResponder = useRef(
        PanResponder.create({
            onStartShouldSetPanResponder: (e, gs) => true,
            onStartShouldSetPanResponderCapture: (e, gs) => true,
            onMoveShouldSetPanResponder: (e, gs) => true,
            onMoveShouldSetPanResponderCapture: (e, gs) => true,
            onPanResponderGrant: (e, gs) => {
					clearInterval(intervalId);
			},
			onPanResponderEnd: (e, gs) => {
				springFlag.current = 0;
				startInterval();
				},
            onPanResponderMove: (e, gs) => {
                let xOrigin = xCenter - (dialRadius + btnRadius);
                let yOrigin = yCenter - (dialRadius + btnRadius);
                let a = cartesianToPolar(gs.moveX - xOrigin, gs.moveY - yOrigin);
                if (phase.current === 'initial' || phase.current === 'break' || phase.current === 'breakOT'){
                    if ( a > 150 && refAngle.current < 100) {        //Stop it from going back at the start.
                        setAngle(min);
                        refAngle.current = min;
                    } else if (a >= max) {                          //If it completes circle
                        startFocus();
                        storeSession();
                    } else if (a < 90 && refAngle.current > 270){   //If it jumps from almost complete to the past-the-start
                        startFocus();
                        storeSession();
                    }
                    else {
                        setAngle(a);
                        refAngle.current = a;
                    }
                }
                else if (phase.current === 'focusOT'){
                    if (a < 150 && refAngle.current > 285) {     //Stop it going forward at the start
                        setAngle(max);
                        refAngle.current = max;
                    } else if (a < min + 2) {                     // Completes anticlockwise circle
                        startBreak();

                    } else if (a > 270 && refAngle.current < 90){       //If it jumps from almost complete to the past-the-start
                        startBreak();
                    }
                    else {
                        setAngle(a);
                        refAngle.current = a;
                    }
                }
            },
        })
    ).current;


	let intervalId;

    const startFocus = () => {
        setAngle(max);
        refAngle.current = max;
        phase.current = 'focus';
        setPhaseState('focus');
        storeAsyncData([
            ['currentPhase','focus'],
            ['currentPhaseDuration',focusTime.current],
            ['currentPhaseStart',Math.floor(Date.now() / 1000)],
         ]);
        startBlock();
    };

    const resumeFocus = (dur:number) => {
        focusTime.current = dur;
        setAngle(max);
        refAngle.current = max;
        phase.current = 'focus';
        setPhaseState('focus');
    };

    const startBreak = () => {
        setAngle(min);
        refAngle.current = min;
        phase.current = 'break';
        setPhaseState('break');
        storeAsyncData([
            ['currentPhase','break'],
            ['currentPhaseDuration',breakTime.current],
            ['currentPhaseStart',Math.floor(Date.now() / 1000)],
        ]);
    };

    const resumeBreak = (dur:number) => {
        focusTime.current = dur;
        setAngle(min);
        refAngle.current = min;
        phase.current = 'break';
        setPhaseState('break');
    };


    const polarToCartesian = useCallback(
        (angle) => {
            let r = dialRadius;
            let hC = dialRadius + btnRadius;
            let a = ((angle - 90) * Math.PI) / 180.0;

            let x = hC + r * Math.cos(a);
            let y = hC + r * Math.sin(a);
            return { x, y };
        },
        [dialRadius, btnRadius]
    );

    const cartesianToPolar = useCallback(
        (x, y) => {
            let hC = dialRadius + btnRadius;

            if (x === 0) {
                return y > hC ? 0 : 180;
            } else if (y === 0) {
                return x > hC ? 90 : 270;
            } else {
                return (
                    Math.round((Math.atan((y - hC) / (x - hC)) * 180) / Math.PI) +
                    (x > hC ? 90 : 270)
                );
            }
        },
        [dialRadius, btnRadius]
    );

    const width = (dialRadius + btnRadius) * 2;
    const bR = btnRadius;
    const dR = dialRadius;
    const startCoord = polarToCartesian(0);
    var endCoord = polarToCartesian(angle);

    const randomiseTimes = ()=> {
        readAsyncStore('RandomGuy').then((randomGuy) => {
            if (randomGuy != null){
                if (randomGuy.toString() === 'true'){
                    const minF = 900;
                    const maxF = 1800;
                    const randomNumber = Math.floor(Math.random() * (maxF - minF + 1) + minF);
                    const minB = 300;
                    const maxB = 900;
                    const randomNumber2 = Math.floor(Math.random() * (maxB - minB + 1) + minB);
                    focusTime.current = Math.round(randomNumber);
                    breakTime.current = Math.round(randomNumber2);

                }}
           });};

    const storeSession = () => {
        readAsyncStore('sessionEnd').then((session) => {
            if (session !== null){
                if (Math.floor(Date.now() / 1000) < parseInt(session)) {
                    const sessionEnd = Math.floor(Date.now() / 1000) + (60 * 60);
                    storeAsyncData([['sessionEnd', sessionEnd]]);
                    readAsyncStore('sessionStart').then((sessionKey) => {
                        writeToPeriod('breakOT', timeOnClock.current);
                        addPeriodToSession(sessionKey as string, sessionEnd, focusTime.current, breakTime.current);

                        randomiseTimes();
                        });
                    }
                else if (Math.floor(Date.now() / 1000) >= parseInt(session)){
                    newSessionHandler();
                }

                } else {
                    newSessionHandler();
                }
          }).catch((error) => {
            console.log(`Error checking if value exists: ${error}`);
          });
    };

    const newSessionHandler = () => {
        const startTime = Math.floor(Date.now() / 1000);
        const endTime = startTime + (60 * 60);
        randomiseTimes;
        storeAsyncData([['sessionStart', startTime ] , ['sessionEnd', endTime], ['currentPeriod', 1]]);
        createNewSession(startTime,endTime, focusTime.current, breakTime.current);
    };


    const endSession = () => {
        const oldPhase = phaseState;
        const oldTime = timeOnClock.current;
        setAngle(0);
        refAngle.current = 0;
        phase.current = 'initial';
        setPhaseState('initial');
        NativeModules.BlockUnblock.endBlock();
		storeAsyncData([['sessionEnd',Math.floor(Date.now() / 1000 )]]);
        if (oldPhase === 'focus'){
            writeToPeriod('focusEnd',oldTime);
        }
		randomiseTimes();
    };

    const setupButton = () => {
        setShowOptions(false);
        storeAsyncData([['setupComplete', 0]]).then( ()=>{
        readAsyncStore('setupComplete').then((complete) =>{
            route.params.setupComplete();});});
    };

    const startBlock = () => {
        readAsyncStore('selection').then(data =>{
            if (data == null){ return (console.log('Error, no selection data'));}
            else {
                NativeModules.BlockUnblock.createBlock(data, focusTime.current);
            }
            });
    };

    const logOutButton = () => {
        hideOptionsPopup();
		endSession();
        handleLogOut().then( ()=>{
            route.params.logout();
            ;});
    };


	const toggleHelpPopup = () =>{
        setShowHelp(!showHelp);
    };

    const showOptionsPopup = () =>{
        setShowOptions(true);
    };

    const hideOptionsPopup = () => {
        setShowOptions(false);
    };

    const toggleHardMode = () => {
        setHardMode(!hardMode);
    };


	const intervalCallback = () => {
		if ((phase.current === 'initial') || (phase.current === 'break') || (phase.current === 'breakOT')){
					if (refAngle.current > 5) {
						refAngle.current -= 7;
						setAngle(refAngle.current);
					} else {
						refAngle.current = 0;
						setAngle(0);
					clearInterval(intervalId);
					}
		} else if (phase.current === 'focusOT'){

					if (refAngle.current < 354) {
						refAngle.current += 5;
						setAngle(refAngle.current);
					} else {
						refAngle.current = 359;
						setAngle(359);
					clearInterval(intervalId);
					}
		} else if (phase.current == 'focus'){
			clearInterval(intervalId);
		}
	};

	const startInterval = () => {
		if (springFlag.current === 0){
			intervalId = setInterval(intervalCallback, 5);
			springFlag.current = 1;
		}
	};
	startInterval();
	let xmlSwitch;
	let xmlBlank = blankHandle;

	if ((phase.current === 'initial') || (phase.current === 'break') || (phase.current === 'breakOT')){
	    xmlSwitch = `
	<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="2500" height="2500" viewBox="0 0 2500 2500">
	<image id="Background_copy_2" data-name="Background copy 2" x="622" y="838" width="1257" height="982" xlink:href="data:img/png;base64,"/>
	<image x="364" y="791" width="1717" height="719" xlink:href="data:img/png;base64,"/>
  </svg>
  
`
} else if (phase.current === 'focusOT'){
	xmlSwitch = `
	<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="2500" height="2500" viewBox="0 0 2500 2500">
	<image id="Background_copy_2" data-name="Background copy 2" x="621" y="838" width="1257" height="982" xlink:href="data:img/png;base64,"/>
	<image x="419" y="791" width="1717" height="719" xlink:href="data:img/png;base64,"/>
  </svg>
  
`
} else if (phase.current === 'focus'){
	xmlSwitch = xmlBlank;
}



const animationProgress = useRef(new Animated.Value(0));

useEffect(() => {
	if (phase.current === 'focus'){
		animationProgress.current.setValue(0)
  Animated.timing(animationProgress.current, {
	toValue: 1,
	duration: 700,
	easing: Easing.linear,
	useNativeDriver: false,
  }).start();
}
}, [phaseState]);



	const renderStatusText = () => {
		if (phase.current === 'focus'){
			return (<Text
				fill={'#000000'}
				fontFamily='Cuprum-BoldItalic'
				y = {50}
				x = {-20}
				fontSize={20}>focus</Text>)
		} else if (phase.current === 'break'){
			return (<Text
				fill={'#000000'}
				fontFamily='Cuprum-BoldItalic'
				y = {50}
				x = {-20}
				fontSize={20}>break</Text>)
		} else if (phase.current === 'focusOT'){
			return (<Text
				fill={'#368132'}
				fontFamily='Cuprum-BoldItalic'
				y = {50}
				x = {-30}
				fontSize={20}>overtime</Text>)
		}
	}


    return (
    // eslint-disable-next-line react-native/no-inline-styles
    <Animated.View style={{flex: 1, alignItems: 'center', justifyContent: 'center'}}>
        
		<View style={{position: 'absolute', bottom: 150}}>
        <Svg id ="slider" width={width} height={width}>
            <G x={bR} y={50} style= {{transform: [{rotate:'45deg'}]}}>
                <Text> {startCoord.x} {startCoord.y} ${endCoord.x} ${endCoord.y}</Text>
                <LottieView
                style = {{height: 500, width: 200, top: -64, left:-22}}
                pointer-events= "none"
                source={require('../assets/sparkle.json')}
                progress={animationProgress.current}
                />
            </G>
            <G x = {width / 2}
                y = {width / 2}>
                <Circle
                    r={dR}
                    stroke={strokeColor}
                    strokeWidth={strokeWidth}
                    fill={fillColor}
                />
                    {/* <Timer duration={focusTime.current}
                    breakDuration={breakTime.current}
                    y = {textSize / 2.5}
                    x = {-94}
                    fontSize={textSize}
                    timerStatus={phase}
                    setPhaseState={setPhaseState}
                    timeOnClock={timeOnClock}
                    resumeFocus ={resumeFocus}
                    resumeBreak={resumeBreak}
                    /> */}
                {renderStatusText()}


            </G>
            <Path
                stroke={meterColor}
                strokeWidth={dialWidth}
                fill="none"
                d={`M${startCoord.x} ${startCoord.y} A ${dR} ${dR} 0 ${
                    angle > 180 ? 1 : 0
                } 1 ${endCoord.x} ${endCoord.y}`}
            />
            <G x={endCoord.x - bR} y={endCoord.y - bR}>

                <Circle
                    r={bR}
                    cx={bR}
                    cy={bR}
                    fill={btnColor}
                    {...panResponder.panHandlers}
                    z-index = {3}
                    opacity={0}
                />

				<G z= {0} x={15} y={13}>
				<SvgXml
                x={bR}
                y={bR}
                xml={xmlBlank} width="90" height="90"
                transform={'rotate(' + angle + ' 1250 1250)'}
                z-index = {4}
                pointer-events="none"
				/>
				</G>

				<G z= {0} x={15} y={13}>
				<SvgXml
                x={bR}
                y={bR}
                xml={xmlSwitch} width="90" height="90"
                transform={'rotate(' + angle + ' 1250 1250)'}
                z-index = {6}
                pointer-events="none"
                />
                </G>
            </G>
        </Svg>
		</View>
        {hardMode ? (
        <NormalText />
        ) : (
            (phaseState === 'initial' || phaseState === 'breakOT') ? (<NormalText />) : (
				<TouchableOpacity
				style={{position: 'absolute', bottom: 150}}
				onPressIn={endSession}>
				<NormalText>End Study Session</NormalText>
			</TouchableOpacity>
        ))
        }
        {(phaseState === 'focus') ? (<NormalText />) : (
			<View style={{flexDirection: 'row', position: 'absolute', top: 70, right: 15}}>

			<TouchableOpacity
            onPressIn={toggleHelpPopup}>
                <NormalImage
                    source={require('../assets/question.png')}
                    style = {{width:40, height:40, marginRight:10}}
                />
            </TouchableOpacity>
			<TouchableOpacity
            onPressIn={showOptionsPopup}>
                <NormalImage
                    source={require('../assets/setting.png')}
                    style = {{width:40, height:40}}
                    />
       		</TouchableOpacity>



		</View>
        )}


<Modal transparent={true} visible={showOptions}>
<BlurView
    style={{ flex: 1 }}
    blurType="light" // Change the blurType as per your preference
    blurAmount={5} // Change the blurAmount as per your preference
  >
  <View style={{ flex: 1,justifyContent: 'center',
    alignItems: 'center', marginHorizontal: 'auto'}}>
    <View style={{ backgroundColor: '#ffffff', marginHorizontal:15, padding: 20, borderRadius: 10, flexDirection: 'row', alignItems: 'center' }}>


      <View style={{ flex: 1, borderRightWidth: 1, borderColor: '#ccc', paddingVertical: 20,paddingRight: 10, marginRight: 10, alignItems: 'center' }}>
        {/* <Button onPress={logOutButton} title="Log out" /> */}
		<TouchableOpacity
			onPress={logOutButton}><NormalText>Log out</NormalText>
			</TouchableOpacity>
      </View>
	  <View style={{ flex:1 , borderRightWidth: 1, borderColor: '#ccc', paddingVertical: 20, alignItems: 'center',paddingRight: 10, marginRight: 10 }}>
	  <TouchableOpacity
			onPress={setupButton}><NormalText>Setup</NormalText>
			</TouchableOpacity>
      </View>
      <View style={{flexDirection: 'column', paddingVertical: 20, paddingHorizontal:10 , alignItems: 'center' }}>

			<NormalText>Hard Mode
		</NormalText>
        <Switch
			style={{ marginTop: 20 }}
          trackColor={{ false: 'white', true: 'black' }}
          onValueChange={toggleHardMode}
          value={hardMode}
        />


      </View>
    </View>
		<View style={{ marginTop:20}}>
	<Button  onPress={hideOptionsPopup} title = "Done"/>
		</View>
  </View>
  </BlurView>
</Modal>

<Modal transparent={true} visible={showHelp}>
<BlurView
    style={{ flex: 1 }}
    blurType="light" // Change the blurType as per your preference
    blurAmount={5} // Change the blurAmount as per your preference
  >
  <View style={{ flex: 1,justifyContent: 'center',
    alignItems: 'center', marginHorizontal: 'auto'}}>
    <View style={{ backgroundColor: '#ffffff', marginHorizontal:15, padding: 20, borderRadius: 10, flexDirection: 'column', alignItems: 'center' }}>

			<NormalText style = {{paddingHorizontal:20, paddingVertical:20, textAlign:'center'}}>


				nea uses the 'Pomodoro technique' to help you study.
			</NormalText>
			<NormalText style = {{paddingHorizontal:20, paddingVertical:20, textAlign:'center'}}>
				Start the focus timer by rotating the handle clockwise to complete the circle.
			</NormalText>
			<NormalText style = {{paddingHorizontal:20, paddingVertical:20, textAlign:'center'}}>
				After the focus period, nea will measure your overtime.
			</NormalText>
			<NormalText style = {{paddingHorizontal:20, paddingVertical:20, textAlign:'center'}}>
				When you want to start a break, rotate the handle back anti-clockwise.
			</NormalText>
			<NormalText style = {{paddingHorizontal:20, paddingVertical:20, textAlign:'center'}}>
				Again, nea will keep track of how long you've gone over your break.
			</NormalText>
			<NormalText style = {{paddingHorizontal:20, paddingVertical:20, textAlign:'center'}}>
				Over time, nea will learn what study patterns suit you best.
			</NormalText>
			<NormalText style = {{paddingHorizontal:20, paddingVertical:20, textAlign:'center'}}>
				nea is in its alpha testing phase, so if you find any bugs I'd love to hear about them.
				You can send me an email with a screenshot at tayyebr@outlook.com.
			</NormalText>
			

    </View>
		<View style={{ marginTop:20}}>
	<Button  onPress={toggleHelpPopup} title = "Done"/>
		</View>
  </View>
  </BlurView>
</Modal>

    </Animated.View>
  );
};


export default HomeScreen;

